import { StyleSheet, Text, View } from 'react-native'
import React from 'react'



const AuthStackNavigator = () => {
  return (
    <View>
      <Text>AuthStackNavigator</Text>
    </View>
  )
}

export default AuthStackNavigator

const styles = StyleSheet.create({})
